import React from "react";

const Contact = () => {
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-12">
            <h1 className="text-center">Contact Us</h1>
          </div>
        </div>
      </div>
      <h2>Welcome to BlogBooth</h2>
    </>
  );
};

export default Contact;
